    text1: Bone mineral density is highly heritable, with heritability estimates of
      60%. Your result is a risk based on 14310 genetic variants, specifically called  SNPs,
      found in 6568 genes. Overall, the variants  explains about 14% of the genetic
      variation in bone mineral density between  people, based on current scientific
      knowledge.
    text2: We determined your genotype at all the genomic positions, which are known
      to influence bone mineral density. Your polygenic risk score was calculated
      by summing up the effects of all the individual SNPs. The estimated effect of
      the genetic factors may be enhanced or alleviated by the environment, especially
      by the diet and lifestyle.
  id: bmd
  model_description:
  - Bone mineral density (BMD) is a measure of bone health. A BMD test looks at  bone
    density and compares it to a healthy person of the same age and  biological sex
    to give a measurement. Low BMD is a risk factor for  osteoporosis and bone fractures.
    Vitamin D and calcium work together to  maintain BMD, and taking dietary supplements
    of these may help maintain BMD  in some people.
  more_about_the_disease:
  - text: 'There typically are no symptoms in the early stages of bone loss. But once
      your bones have been weakened by osteoporosis, you might have signs and symptoms
      that include:'
    title: Symptoms
    unordered_list:
    - Back pain, caused by a fractured or collapsed vertebra
    - A stooped posture
    - Loss of height over time
    - A bone that breaks much more easily than expected
  - text: Osteoporosis is more common in people who have hormonal imbalances.
    title: 'Causes '
    unordered_list:
    - Lowered sex hormone levels tend to weaken bone
    - Too much thyroid hormone or overactive adneral glands can cause bone loss.
